import React, { useState, useEffect, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { AuthContext } from '../../context/AuthContext.jsx';

const AdminDashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardStats();
  }, []);

  const fetchDashboardStats = async () => {
    try {
      const response = await axios.get('/api/reports/dashboard');
      if (response.data.success && response.data.dashboard) {
        setStats(response.data.dashboard);
      } else {
        console.error('Invalid response format:', response.data);
        setStats({
          todayCheckIns: 0,
          todayCheckOuts: 0,
          totalRooms: 0,
          occupiedRooms: 0,
          occupancyRate: 0,
          todayRevenue: 0,
          pendingHousekeeping: 0,
          pendingMaintenance: 0
        });
      }
    } catch (error) {
      console.error('Error fetching dashboard stats:', error);
      setStats({
        todayCheckIns: 0,
        todayCheckOuts: 0,
        totalRooms: 0,
        occupiedRooms: 0,
        occupancyRate: 0,
        todayRevenue: 0,
        pendingHousekeeping: 0,
        pendingMaintenance: 0
      });
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading"><div className="spinner"></div></div>;
  }

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <div>
          <h1>Manager Dashboard</h1>
          <p style={{ color: '#666', marginTop: '5px' }}>Complete system overview and management</p>
        </div>
        <button onClick={handleLogout} className="btn btn-danger" style={{ marginLeft: 'auto' }}>
          Logout
        </button>
      </div>

      {stats ? (
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '20px', marginTop: '20px' }}>
          <div className="card">
            <h3>Today's Check-ins</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#007bff' }}>{stats.todayCheckIns || 0}</p>
          </div>
          <div className="card">
            <h3>Today's Check-outs</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#28a745' }}>{stats.todayCheckOuts || 0}</p>
          </div>
          <div className="card">
            <h3>Occupancy Rate</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#ffc107' }}>{stats.occupancyRate || 0}%</p>
            <p>{stats.occupiedRooms || 0} / {stats.totalRooms || 0} rooms</p>
          </div>
          <div className="card">
            <h3>Today's Revenue</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#28a745' }}>${(stats.todayRevenue || 0).toFixed(2)}</p>
          </div>
          <div className="card">
            <h3>Pending Housekeeping</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#dc3545' }}>{stats.pendingHousekeeping || 0}</p>
          </div>
          <div className="card">
            <h3>Pending Maintenance</h3>
            <p style={{ fontSize: '32px', fontWeight: 'bold', color: '#dc3545' }}>{stats.pendingMaintenance || 0}</p>
          </div>
        </div>
      ) : (
        <div className="card" style={{ marginTop: '20px' }}>
          <p>Loading dashboard statistics...</p>
        </div>
      )}

      <div className="card" style={{ marginTop: '20px' }}>
        <h2>Quick Actions</h2>
        <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap', marginTop: '20px' }}>
          <a href="/users" className="btn btn-primary">Manage Users</a>
          <a href="/rooms" className="btn btn-primary">Manage Rooms</a>
          <a href="/reservations" className="btn btn-primary">View Reservations</a>
          <a href="/reports" className="btn btn-primary">View Reports</a>
          <a href="/billing" className="btn btn-primary">Billing</a>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
